INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (1, 10004, 1, "2023/06/30 12:00:00", "ライラエル", 0.0, 126501, -470.0, "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", 2002, "2023/09/22 14:59:59", 0.0, 1, 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2, 10005, 2, "2023/09/15 15:00:00", "リンド", 0.0, 127702, -470.0, "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", 2002, "2023/12/22 14:59:59", 0.0, 2, 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2, 10006, 2, "2023/09/15 15:00:00", "リンド", 0.0, 127702, -470.0, "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", 2002, "2023/12/22 14:59:59", 0.0, 2, 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (1, 10007, 2, "2023/09/15 15:00:00", "ヴルム", 0.0, 127802, -470.0, "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", 2002, "2023/12/22 14:59:59", 0.0, 1, 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (1, 10008, 2, "2023/09/15 15:00:00", "ヴルム", 6.5, 127802, -470.0, "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", 2002, "2023/12/22 14:59:59", 0.0, 2, 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (1, 10009, 3, "2023/12/15 15:00:00", "アネモネ", 0.0, 129602, -470.0, "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", 2002, "2024/03/22 14:59:59", 0.0, 2, 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (1, 10010, 3, "2023/12/15 15:00:00", "アネモネ", 0.0, 129602, -470.0, "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", 2002, "2024/03/22 14:59:59", 0.0, 2, 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (1, 10011, 3, "2023/12/15 15:00:00", "ネフィ=ネラ", 0.0, 129701, -470.0, "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", 2002, "2024/03/22 14:59:59", 0.0, 1, 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (1, 10012, 3, "2023/12/15 15:00:00", "ネフィ=ネラ", 6.2, 129701, -470.0, "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", 2002, "2024/03/22 14:59:59", 0.0, 2, 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (5, 10013, 4, "2024/03/15 15:00:00", "カノン", 3.1, 130301, -470.0, "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", 2002, "2024/06/22 14:59:59", 0.0, 3, 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2, 10014, 4, "2024/03/15 15:00:00", "カノン", 6.15, 130301, -470.0, "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", 2002, "2024/06/22 14:59:59", 0.0, 3, 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2, 10015, 4, "2024/03/15 15:00:00", "ナーナ", 0.0, 130401, -470.0, "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 2002, "2024/06/22 14:59:59", 0.0, 2, 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (1, 10016, 4, "2024/03/15 15:00:00", "ナーナ", 3.35, 130401, -470.0, "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", 2002, "2024/06/22 14:59:59", 0.0, 2, 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (1, 10017, 5, "2024/06/15 15:00:00", "ホウオウ", 0.0, 130502, -470.0, "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", 2002, "2024/09/22 14:59:59", 0.0, 1, 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (1, 10018, 5, "2024/06/15 15:00:00", "ホウオウ", 3.18, 130502, -470.0, "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", 2002, "2024/09/22 14:59:59", 0.0, 2, 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (4, 10019, 5, "2024/06/15 15:00:00", "ホウオウ", 0.0, 130503, -470.0, "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", 2002, "2024/09/22 14:59:59", 0.0, 4, 3);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2, 10020, 5, "2024/06/15 15:00:00", "ネア", 4.9, 123301, -470.0, "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", 2002, "2024/09/22 14:59:59", 0.0, 1, 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2, 10021, 5, "2024/06/15 15:00:00", "ネア", 4.8, 123301, -470.0, "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", 2002, "2024/09/22 14:59:59", 0.0, 1, 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (1, 10022, 6, "2024/09/15 15:00:00", "カリザ", 4.922, 133301, -470.0, "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", 2002, "2024/12/22 14:59:59", 0.0, 3, 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (5, 10023, 6, "2024/09/15 15:00:00", "カリザ", 9.638, 133301, -470.0, "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", 2002, "2024/12/22 14:59:59", 0.0, 3, 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2, 10024, 6, "2024/09/15 15:00:00", "ミーア", 2.88, 133401, -470.0, "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 2002, "2024/12/22 14:59:59", 0.0, 1, 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (1, 10025, 6, "2024/09/15 15:00:00", "ミーア", 4.818, 133401, -470.0, "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", 2002, "2024/12/22 14:59:59", 0.0, 5, 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (1, 10026, 7, "2024/12/15 15:00:00", "グレイス", 1.78, 133002, -470.0, "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", 2002, "2025/03/22 14:59:59", 0.0, 2, 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (7, 10027, 7, "2024/12/15 15:00:00", "グレイス", 6.15, 133002, -470.0, "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", 2002, "2025/03/22 14:59:59", 0.0, 1, 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2, 10028, 7, "2024/12/15 15:00:00", "ヴァイオレット", 4.28, 133102, -470.0, "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", 2002, "2025/03/22 14:59:59", 0.0, 6, 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (1, 10029, 7, "2024/12/15 15:00:00", "ヴァイオレット", 0.0, 133102, -470.0, "じめじめした商品は\nございませんので\n安心してお買い求め下さい", 2002, "2025/03/22 14:59:59", 0.0, 1, 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (1, 10030, 8, "2025/03/15 15:00:00", "ルルィ", 5.53, 136902, -470.0, "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！", 2002, "2025/06/23 14:59:59", 0.0, 2, 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (7, 10031, 8, "2025/03/15 15:00:00", "ルルィ", 6.05, 136902, -470.0, "そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…", 2002, "2025/06/23 14:59:59", 0.0, 9, 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (1, 10032, 8, "2025/03/15 15:00:00", "デュラン", 0.0, 137001, -470.0, "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ", 2002, "2025/06/23 14:59:59", 0.0, 2, 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (1, 10033, 8, "2025/03/15 15:00:00", "デュラン", 0.0, 137001, -470.0, "キャラバンコインではなく\n首で支払って貰えんかのぅ\n…冗談であるぞ？", 2002, "2025/06/23 14:59:59", 0.0, 2, 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2, 10034, 9, "2025/06/16 15:00:00", "サツキ", 0.0, 135902, -470.0, "おう\n好きなもん持ってきな", 2002, "2025/09/23 14:59:59", 0.0, 2, 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (6, 10035, 9, "2025/06/16 15:00:00", "サツキ", 4.935, 135902, -470.0, "宵越しの銭を持つような\n野暮いマネぁしくさんな\nツキが落ちてもしらねぇぜ", 2002, "2025/09/23 14:59:59", 0.0, 1, 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (5, 10036, 9, "2025/06/16 15:00:00", "ユキノ", 7.441, 135802, -470.0, "ら、ら、らっしゃっせ…\nなんかほしいもん、ある？\nか、かき氷とか、ど…？", 2002, "2025/09/23 14:59:59", 0.0, 2, 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (7, 10037, 9, "2025/06/16 15:00:00", "ユキノ", 0.0, 135802, -470.0, "そ、そんな見ねぇで…\nあては、売りもんじゃ\nねぇよ…？", 2002, "2025/09/23 14:59:59", 0.0, 7, 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2, 10038, 10, "2025/09/16 15:00:00", "クルル", 2.295, 130901, -470.0, "クルルをお求めですかっ？\nそれならお礼に、こちらの\n宝石もどうぞですよ～♪", 2002, "2025/12/22 14:59:59", 0.0, 2, 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (6, 10039, 10, "2025/09/16 15:00:00", "クルル", 6.281, 130901, -470.0, "はっ！　ヒーローさんから\nお代なんて頂けないです！\nどうぞどうぞ…え、ダメ？", 2002, "2025/12/22 14:59:59", 0.0, 1, 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (1, 10040, 10, "2025/09/16 15:00:00", "ヴォルガーノ", 5.549, 137701, -470.0, "よぅ！　今日の俺さまは\n門番じゃなく、店番だぜ\nメモピ～スフィア～てな！", 2002, "2025/12/22 14:59:59", 0.0, 2, 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (6, 10041, 10, "2025/09/16 15:00:00", "ヴォルガーノ", 2.64, 137701, -470.0, "…リマさんのブロマイド？\n買い取るに決まってらぁ！\nなんでも持ってけ泥棒っ！", 2002, "2025/12/22 14:59:59", 0.0, 3, 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (4, 10042, 11, "2025/12/15 15:00:00", "ライラエル", 7.642, 132801, -470.0, "こ、この格好は…ヴルムが\n集客効果があると言って…\n…本当でしょうか？", 2002, "2026/03/23 11:59:59", 0.0, 7, 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (1, 10043, 11, "2025/12/15 15:00:00", "ライラエル", 0.0, 132802, -470.0, "この我に店番させるとは…\n全て買わねば許さぬぞ\n我が国庫に貢献するが良い", 2002, "2026/03/23 11:59:59", 0.0, 1, 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (1, 10044, 11, "2025/12/15 15:00:00", "クローチェ", 0.0, 134502, -470.0, "アナライズっ！\n本日のオススメ商品は～…\nこちらですっ♪", 2002, "2026/03/23 11:59:59", 0.0, 1, 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (1, 10045, 11, "2025/12/15 15:00:00", "クローチェ", 3.72, 134501, -470.0, "ギガンティックローチェ、\nおひとついかがですかっ？\n格納庫用意して下さいねっ", 2002, "2026/03/23 11:59:59", 0.0, 2, 2);
